$(document).find("#contact-form").validate(),$(document).find("#contact-form").on("submit",function(t){let e=$(this);if(t.preventDefault(),!$(this).valid()){$(".form-messages").html('<div class="alert alert-danger">'+e.attr("error-message")+"</div>");return}$.ajax({type:e.attr("method"),url:e.attr("action"),data:e.serialize(),success:function(t){"success"===t.status&&$(".form-messages").html('<div class="alert alert-success">'+t.message+"</div>")},complete:function(){e.find('input[type="submit"]').attr("disabled",!1),e[0].reset()}})});